  return (
    <div className={classes.homemap}>
      {/* <div className={classes.home_}> */}
        <img src={home5} />
        <h1>Address</h1>
        <p>Ambavadi vas, Kanodar, T.A.-Palanpur, Dist.-Banaskantha, Gujarat - 385520</p>
      {/* </div> */}
      {/* <div className={classes.map_}>
        <img src={home5} />
        <p></p>
      </div> */}
    </div>
  );
};

export default AddressMap;
